	public static int lengthOfLongestSubstring(String s) {

		int res = 0;
		int index = 0;
		Map<Character, Integer> map = new HashMap<Character, Integer>();
		int minIndex = 0;
		while(index < s.length()) {
			char cur = s.charAt(index);
			if(!map.containsKey(cur)) {
				map.put(cur, index);
				res = Math.max(res, index - minIndex + 1);
			}else {
				int pre = Math.max(minIndex, map.get(cur) + 1);
				res = Math.max(res, index - pre + 1);
				map.put(cur, index);
				minIndex = pre;
			}
			index ++;
		}
		return res;

	}

